import  Axios  from 'axios'
import React, { useEffect, useState } from 'react'

export default function AdminPage() {
  const [data, setData] = useState<any>();
  const [selectedUser, setSelectedUser] = useState<string>();
  useEffect(() => {
    Axios.get("http://localhost:8000/getalluser", {
      withCredentials: true
    }).then(res => {
      setData(res.data)
    })
  }, []);
  if (!data) {
    return null;
  }
  return (
    <>
      <h1>Admin page hanya admin  yang bisa lihat </h1>
      <select onChange={e => setSelectedUser(e.target.value)} name="deleteuser" id='deleteuser'>
        {
          data.map((item: any) => {
            return (
              <option id={item.username}>{item.username}</option>
          )
        })  
        
        } 
      </select>
    </>
  )
}
